import { useActionState } from "react";


async function increment(previousState: number, formData: any): Promise<number> {
  return previousState + 1;
}

async function decrement(previousState: number, formData: any): Promise<number> {
  return previousState - 1;
}
function ObjectName() {
    return<label>相手キャラ: <input type="text" placeholder="これがプレースホルダー"/></label>
}

function CountRate({ rate }: { rate: number }) {
    return <div>WinRate: {rate.toFixed(2)}</div>;
}
export function CounterApp({}) {
  const [state, dispatch] = useActionState(increment, 0);
  const handleIncrement = () => dispatch(increment);
  const handleDecrement = () => dispatch(decrement);

  return (
    <form>
      <ObjectName />
      <br />
      {state}
      <button formAction={handleIncrement}>stateIncrement</button>
      <button formAction={handleDecrement}>stateDecrement</button>
      <br />
    </form>
  );
}
